import React from 'react';

const RequestPickup = ({ onClose, onConfirm }) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Dummy form data
    const formData = { date: '2025-10-16', wasteType: 'General' };
    onConfirm(formData);
  };

  return (
    <div style={{ position: 'fixed', right: 0, top: 0, width: '300px', background: '#fff', border: '1px solid #ccc', padding: '1rem', zIndex: 1000 }}>
      <h3>Request Pickup</h3>
      <form onSubmit={handleSubmit}>
        <button type="submit">Confirm Request</button>
        <button type="button" onClick={onClose} style={{ marginLeft: '1rem' }}>Close</button>
      </form>
    </div>
  );
};

export default RequestPickup;
